cy.visit(Cypress.env('quipper_orders'));
cy.url().should('include', '/orders');
cy.get('.OrderStatus--pending').click(); //Get Pricing Plan Title
cy.get('.AccordionSection__title').then(function ($judul) {
  var planTitle = $judul.text();
  cy.wrap(planTitle).as('PricingPlanTitle');
}); //Get Pricing Plan Price
cy.get('.Amount__final').then(function ($harga) {
  var planPrice = $harga.text();
  cy.wrap(planPrice).as('PricingPlanPrice');
}); //Get Payment Code
cy.get('.PaymentCode__transaction-ref').then(function ($code) {
  var planPayCode = $code.text();
  cy.wrap(planPayCode).as('PaymentCode');
});
cy.location('href').then(function (loc) {
  var url = loc.toString();
  cy.wrap(url).as('URL');
});
cy.get('@URL').then(function (URL) {
  var ID1 = URL.split("https://subscribe.quipper.com/orders/");
  var ID = ID1[1];
  cy.wrap(ID).as('IDPaymentSlip');
});
cy.get('@IDPaymentSlip').then(function (IDPaymentSlip) {
  var fileName = IDPaymentSlip.concat(".pdf");
  cy.wrap(fileName).as('DownloadedFileName');
});
cy.get('@DownloadedFileName').then(function (DownloadedFileName) {
  cy.task('getPdfContent', DownloadedFileName).then(function (content) {
    var teks = content.toString();
    cy.wrap(teks).as('PDFContent');
  });
}); //Validate Pricing Plan Title on PDF
cy.get('@PricingPlanTitle').then(function (PricingPlanTitle) {
  cy.get('@PDFContent').then(function (PDFContent) {
    expect(PDFContent).to.contain(PricingPlanTitle);
  });
});
cy.get('@PricingPlanPrice').then(function (PricingPlanPrice) {
  cy.get('@PDFContent').then(function (PDFContent) {
    expect(PDFContent).to.contain(PricingPlanPrice);
  });
});
cy.get('@PaymentCode').then(function (PaymentCode) {
  cy.get('@PDFContent').then(function (PDFContent) {
    expect(PDFContent).to.contain(PaymentCode);
  });
});

